```json
{
  "application": "PBS",
  "details": {
    "resource_requirements": {
      "nodes": "1",
      "gpus": "4",
      "walltime": "1:00:00",
      "account": "jvb-000-ag",
      "feature": "k20"
    },
    "software": {
      "python": "3.x",
      "theano": "latest",
      "importance_sampling_sgd": "latest"
    },
    "configuration_file": "${IMPORTANCE_SAMPLING_SGD_ROOT}/integration_distributed_training/config_files/helios/07_paper_again/config_032.py",
    "bootstrap_file": "${HOME}/bootstrap_experiment_032"
  }
}
```

This script is designed to run on a PBS cluster with a single node and four GPUs, a walltime of one hour, an account of "jvb-000-ag", and the "k20" feature. 

The script relies on Python 3.x, Theano, and the ImportanceSamplingSGD library, using a specific configuration file and bootstrap file for its execution. It launches a database server (run_database.py) and then a master process (run_master.py) and three worker processes (run_worker.py), each assigned to a different GPU.
